import React from 'react';
import {useState} from 'react';
import Axios from 'axios';

import './css/main.css';
import './css/general.css';

const TestContainer = (props) => {
    const {key, img} = props;
    const altText = "Galeriipilt " + key;
    return(
        <React.Fragment key={key}>
            <img src={img} alt={altText}/>
        </React.Fragment>
    );
};

const Main = () => {

    const [imageList, setImageList] = useState([]);

    const getImages = () => {
        console.log("Works");
        Axios.get("http://localhost:3001/getImages").then((response) => {
            setImageList(response.data);
            console.log(response.data);
        }).catch(error => {
            console.log(error.response);
        });
    }


    return(
        <section className="main">
            <section className="introduction">
                <h1>Mait Jurask</h1>
                <h1>PORTFOLIO</h1>
            </section>
            <section>
                {imageList.map((obj) =>{
                    return(
                        <TestContainer key={obj.key} {... obj}></TestContainer>
                    );
                })}
            </section>
            <section className="about">
                <h6>Mait Jurask</h6>
                <img src="" alt="Signature placeholder"/>
                <button type="button" onClick={getImages}>Contact Me</button>
            </section>
        </section>
    );
};

export default Main;
